### Summary of Core Topics, Concepts, Principles, and Equations

#### 1. Functions and Their Properties
- **Function Composition**: Understanding how to compose functions \( f \circ g \) and \( g \circ f \).
- **Domain and Range**: Determining the domain and range of functions and their compositions.
- **One-to-One Functions**: Identifying whether a function is one-to-one (injective).

#### 2. Limits and Continuity
- **Limits**: Evaluating limits of sequences and functions.
  \[
  \lim_{n \to \infty} a_n
  \]
- **Continuity**: Ensuring functions are continuous over their domains, especially piecewise functions.

#### 3. Differentiability
- **Differentiability**: Determining if a function is differentiable at specific points.
- **Derivatives**: Calculating derivatives of polynomial functions.
  \[
  f'(x) = \frac{d}{dx} f(x)
  \]
- **Tangent Lines**: Finding the equation of the tangent line to a function at a given point.
  \[
  y = f'(a)(x - a) + f(a)
  \]

#### 4. Polynomial Functions
- **Polynomials**: Understanding the general form of a polynomial and its derivatives.
  \[
  f(x) = a_5 x^5 + a_4 x^4 + a_3 x^3 + a_2 x^2 + a_1 x + a_0
  \]
  \[
  f'(x) = 5a_5 x^4 + 4a_4 x^3 + 3a_3 x^2 + 2a_2 x + a_1
  \]

#### 5. Logarithmic and Exponential Functions
- **Logarithmic Identities**: Solving equations involving logarithms.
  \[
  m^{\log_3 2} + 2^{\log_3 m} = 8
  \]
- **Exponential Functions**: Evaluating limits involving exponential functions.
  \[
  a_n = \frac{e^{2n} + n^4}{e^{3n} + n^5}
  \]

#### 6. Piecewise Functions
- **Piecewise Functions**: Understanding and working with functions defined by different expressions over different intervals.
  \[
  f(x) = \begin{cases}
  Ax - B & \text{if } x \leq -1 \\
  2x^2 + 3Ax + B & \text{if } -1 < x \leq 1 \\
  4 & \text{if } x > 1
  \end{cases}
  \]

